export default function Users({ userData }) {
    const user = usersData || [{
        first_name: 'Sam',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    }]
    const cardGenerator = () => {
        const Card = () => {
            <div style={{flex: '0 0 auto'}}>
                <img src={user[1].avatar} />
            </div>
        }
    }
    return(
        <div className="flex flex-no-wrap overflow-auto">
            {cardGenerator}
        </div>
    )
}
